                width="100"
                className="img-thumbnail"
                style={{marginTop: "20px"}}
                alt="logo"
            />
            <hr/>
            <nav>
                <a href="/">Главная</a>
                <a href="/category">Категории</a>
            </nav>
        </div>
    )
}

export default Header;
